import React from 'react'
import styled from 'styled-components'

const HeaderWrapper = styled.header`
  width: 100vw;
  height: 75vh;

  display: grid;
  grid-template-columns: 1fr 1fr;
`

const Title = styled.h1`
  font-size: 3.5rem;
  white-space: nowrap;
`
const SubTitle = styled.p``

const Header = () => {
  return (
    <HeaderWrapper>
      <Text>
        <Title>
          Get You Some <br />
          Shortened Links
        </Title>
        <SubTitle>Secure and reliable short links. Via rel.ink api.</SubTitle>
      </Text>
    </HeaderWrapper>
  )
}

export default Header
